function afterStateEntry(sequenceId)
{
	var nr_processo = getValue("WKNumProces");
 
	if (sequenceId == VERIFICAR_SITUACAO_24) 
	{
		var constraints = [
		DatasetFactory.createConstraint("solicitacao", nr_processo, nr_processo, ConstraintType.MUST)
		, DatasetFactory.createConstraint("sqlLimit", "1", "", ConstraintType.MUST)];
		
		var erro = DatasetFactory.getDataset("fluig_erros_integracao", [], constraints, []);
		hAPI.setCardValue("ds_erro_integracao", erro.getValue(0, "detalhe"));
	}
}

function beforeTaskSave(colleagueId,nextSequenceId,userList)
{
	var CURRENT_STATE = getValue("WKNumState");
	var attachments = hAPI.listAttachments();
  
	if (CURRENT_STATE == INICIO_0 || CURRENT_STATE == INICIAR_4)
    {
		if (attachments.size() == 0)
	    {
	        throw "É obrigatória a inclusão de pelo menos um anexo.";
	    }
    }
	

}

var INICIO_0 = 0;
var INICIAR_4 = 4;
var VALIDACAO_FINANCEIRA_NFE_12 = 12;
var VALIDACAO_PATRIMONIO_NFE_PATRIMONIO_16 = 16; //QUANDO REALIZADO PELO DEPTO DE PATRIMONIO
var VALIDACAO_PATRIMONIO_NFE_FINANCEIRO_39 = 39; //QUANDO REALIZADO PELO DEPTO FINANCEIRO
var FIM_REPROVADO_28 = 28;
var FIM_22 = 22;
var VERIFICAR_SITUACAO_24 = 24;
var SERVICO_PUBLICAR_GED_31 = 32;

function servicetask31(attempt, message) {
	
	var pasta_pai = 0;
	var nr_processo = hAPI.getCardValue("vl_num_solic");
	
	//buscando dados da etapa selecionada	
	var cd_contrato = hAPI.getCardValue("cd_contrato");
	var cd_etapa = hAPI.getCardValue("cd_etapa");
	
	try
	{
		var constraints = new Array();
		constraints.push(DatasetFactory.createConstraint("cd_contrato", cd_contrato, cd_contrato, ConstraintType.MUST));
		constraints.push(DatasetFactory.createConstraint("cd_etapa", cd_etapa, cd_etapa, ConstraintType.MUST));
		var dataset = DatasetFactory.getDataset("geral_cadastro_etapa", null, constraints, null);
		
		if (dataset != null)
		{
			if (dataset.rowsCount > 0) 
			{	
				var companyId = dataset.getValue(0, "companyid");
				var id = dataset.getValue(0, "metadata#id");
				var documentId  = dataset.getValue(0, "documentId");
				var vl_num_solic     = dataset.getValue(0, "vl_num_solic");
				var vl_num_solic  = dataset.getValue(0, "vl_num_solic");
			    var documentVersion = dataset.getValue(0, "metadata#version");
				
			    var constraintsFilhos = new Array();
				constraintsFilhos.push(DatasetFactory.createConstraint("companyid", companyId ,companyId, ConstraintType.MUST));
			    constraintsFilhos.push(DatasetFactory.createConstraint("tablename", "table_ged" ,"table_ged", ConstraintType.MUST));
			    constraintsFilhos.push(DatasetFactory.createConstraint("metadata#id", id, id, ConstraintType.MUST));
			    constraintsFilhos.push(DatasetFactory.createConstraint("tipo_ged", "nfe", "nfe", ConstraintType.MUST));
			    constraintsFilhos.push(DatasetFactory.createConstraint("metadata#version", documentVersion, documentVersion, ConstraintType.MUST));
			    var datasetFilho = DatasetFactory.getDataset("geral_cadastro_etapa", null, constraintsFilhos, null);
			    
			    if (datasetFilho != null)
			    {
			    	if (datasetFilho.rowsCount > 0) 
					{	
			    		pasta_pai = parseInt(datasetFilho.getValue(0, 'id_pasta'));
						publishAttachments(pasta_pai);
					}
		   	   	}
			}
		}
		else
		{
			var erro = "Erro ao publicar o documento, etapa do contrato não encontrada."
				var constraints = [
				DatasetFactory.createConstraint("acao", "inserir", "", ConstraintType.MUST)
				, DatasetFactory.createConstraint("solicitacao", nr_processo, "", ConstraintType.MUST)
				, DatasetFactory.createConstraint("detalhe", erro, "", ConstraintType.MUST)];
				DatasetFactory.getDataset("fluig_erros_integracao", [], constraints, []);

			throw erro;
		}
	}
	catch(e)
	{
		var erro = "Erro ao publicar o documento, configuração inexistente ou errada."
			var constraints = [
			DatasetFactory.createConstraint("acao", "inserir", "", ConstraintType.MUST)
			, DatasetFactory.createConstraint("solicitacao", nr_processo, "", ConstraintType.MUST)
			, DatasetFactory.createConstraint("detalhe", erro, "", ConstraintType.MUST)];
			DatasetFactory.getDataset("fluig_erros_integracao", [], constraints, []);

		throw erro;
	}

}
 
function publishAttachments(folderId){
	
	var cd_contrato = hAPI.getCardValue("cd_contrato"); //criar no form
	var ds_etapa = hAPI.getCardValue("zoom_etapa");
	var ds_nfe_vinculada = hAPI.getCardValue("ds_nfe_vinculada");
	
	var vl_num_solic = hAPI.getCardValue("vl_num_solic");
	var ds_tipo_registro = hAPI.getCardValue("cb_tipo");
	var ds_prefixo = "NF";
	
	if (ds_tipo_registro == "carta_correcao")
	{
		ds_prefixo = "CC";
	}
	
	
	var workflowAttachments = hAPI.listAttachments();
	
	for (var i = 0; i < workflowAttachments.size(); i++) {
		var descricao_documento = ds_prefixo + ' - ' + vl_num_solic + ' - 000' + (i+1);
		var docDto = workflowAttachments.get(i);
		var attachments = getAttachments(docDto);
		
		docAPI.copyDocumentToUploadArea(docDto.getDocumentId(), docDto.getVersion());
		
		docDto.setDocumentId(0);
		docDto.setParentDocumentId(folderId);
		docDto.setInheritSecurity(true);
		
		docDto.setKeyWord(cd_contrato);
		docDto.setKeyWord(ds_etapa);
		docDto.setKeyWord(ds_nfe_vinculada);
		
		
		docDto.setDocumentDescription(descricao_documento);
		
		try {
			var idDocument = docAPI.createDocument(docDto, attachments, null, null, null);

			idDocument.getDocumentId();
			
		} catch (e) {
			throw "Erro ao publicar o documento, por favor, contate o administrador.<br/><br/> "+ e;
		}
	}	
}

/**********************************************************************************************************************
 * Pega os anexos de um documento.
 * 
 * @param docDto
 * @returns {java.util.ArrayList}
**********************************************************************************************************************/
function getAttachments(docDto) {
	var attachmentArray = new java.util.ArrayList();
	
	var attachment = docAPI.newAttachment();
	attachment.setFileName(docDto.getPhisicalFile());
	attachment.setPrincipal(true);
	attachment.setAttach(false);
	attachmentArray.add(attachment);
	return attachmentArray;
}
